/* Query to get ALLWISE information for ZTF19aascdol */
SELECT x.oid, /* ZTF identifier */  x.oid_catalog, /* ALLWISE identifier */  x.dist, /* Distance between matches in arcsec */  a.w1mpro, /* W1 magnitude */  a.w2mpro, /* W2 magnitude */  a.w3mpro, /* W3 magnitude */  a.w4mpro /* W4 magnitude */
FROM xmatch x
INNER JOIN allwise a ON x.oid_catalog = a.oid_catalog /* Fixed join condition to use correct column name from allwise table */
WHERE x.oid = 'ZTF19aascdol'
  AND x.catid = 'ALLWISE';
